  //     .catch(err => console.log(err));
  // };
  render() {
    const { classes } = this.props;

    return (
      <div className={classes.section}>
        <h2 className={classes.title}>Here are your saved books</h2>
        <div>
          <GridContainer>
            <Book
              page="delete"
              key={""}
              link={""}
              description={""}
              authors={""}
              image={""}
            />
          </GridContainer>
        </div>
      </div>
    );
  }
}

export default withStyles(teamStyle)(Saved);
